import logo from "./logo.svg";
import "./App.css";

function App() {
  const styleBox = {
    height: "100px",
    width: "100px",
    border: "1px solid black",
    display: "flex",
    "flex-direction": "column",
    "align-items": "center",
    "justify-content": "center",
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>To-Do List</h1>
      </header>
      <div style={styleBox}></div>
    </div>
  );
}

export default App;
